import TableItem from 'components/TableItem';

const TableItemGroup = ({meals, saveMeal, idx, toggleEditing, editingIndexes}) => {
    return meals.map(meal => <TableItem 
                                meal={meal}
                                toggleEditing={toggleEditing}
                                isEditing={contains(`item-${idx}`, editingIndexes)} 
                                id={`item-${idx}`}
                                saveMeal={saveMeal}
                            />)
}
